function onEachNeighborhoodFeature(feature, layer) {
	layer.setStyle(styleNeighborhood);
	layer.bindTooltip("click for workers home locations",{direction:"auto",sticky:true});
	
	layer.on('mouseover', function(e) {
              layer.setStyle(highlightStyle);
    });
    layer.on('mouseout', function(e) {
              layer.setStyle(styleNeighborhood);
    });
	layer.on('click', function(e) {
			  map.setView([e.latlng.lat,e.latlng.lng],13);	
              map.removeLayer(layerNeighborhood);
			  function getLayer(e){
				var p = e.target.feature.properties.shape_name;
				if (p === "Allison Hill & Harrisburg East"){return layersAllison; }
				else if (p === "City Island"){return layersCityIsland; }
				else if (p === "Downtown"){return layersDowntown; }
				else if (p === "Industrial Corridor"){return layersIndustrial; }
				else if (p === "Midtown"){return layersMidtown; }
				else if (p === "Riverfront"){return layersRiverfront; }
				else if (p === "Southern Harrisburg"){return layersSouth; }
				else if (p === "Capitol Complex"){return layersStateGov; }
				else if (p === "Uptown"){return layersUptown; }
				else {console.log("error")}
			  }
			  map.addLayer(getLayer(e));
			  $("#resetMapButton").css("visibility","visible");
			  $("#legend").css("visibility","visible");
    });
}

function resetCircleStyle(e) {e.target.setStyle({weight: 1})}

function getCircleColor(color){
	if(color === 1){return "#BF55EC";}
	else{return "#f1c40f";}
}

function getStyleCirclePoints(x,y){
		return {

			weight: 1,
			opacity: 1,
			fillOpacity: 0.5,
			clickable: true
		}};

	return L.circleMarker(latlng,getStyleCirclePoints(feature.properties.S, feature.properties.A));
